import { useReducer, useState } from "react";

export default function RegistrationForm() {

    const init = {
        user_name: {value:0,valid: false, touched: false, error:""},
        password: {value:"",valid: false, touched: false, error:""},
        contact: {value:0,valid: false, touched: false, error:""},
        email: {value:0,valid: false, touched: false, error:""},
        formValid: false
    }

    const reducer = (state,action) => {
        switch(action.type)
        {
            case 'update':
                //object destructuring
                const {key,value,touched,valid,error,formValid} = action.data;
                return {...state,[key]:{value,touched,valid,error},formValid}
            case 'reset':
                return init;        
        }
    }

    const[user,dispatch] = useReducer(reducer,init)

    const[flag,setFlag]=useState(false)
    const[flag1,setFlag1]=useState(false)

    var submitData=(e)=>{
        e.preventDefault();
        setFlag1(!flag1)
    }
    

    const validateData = (key,val) => {
        let valid = true;
        let error = ""
        switch(key)
        {
            case 'user_name':
               var pattern = /^[0-9]{4}$/ 
               if(!pattern.test(val))
               {
                  valid = false;
                  error = "userno should be 4 digits only"
               }

               break;
            case 'password': 
                var pattern = /^[0-9]{4}$/ 
                if(!pattern.test(val))
                {
                    valid = false;
                    error = "userno should be 4 digits only"
                }
                break;
            case 'contact':
                var pattern = /^[0-9]{4}$/ 
               if(!pattern.test(val))
               {
                  valid = false;
                  error = "userno should be 4 digits only"
               }

               break;
            case 'email':
                var pattern = /^[0-9]{4}$/ 
               if(!pattern.test(val))
               {
                  valid = false;
                  error = "userno should be 4 digits only"
               }

               break;
        }
        return { valid: valid, error: error}
    }

    
    const handleChange = (key,value) => {
        //1. call validateData function
        const {valid, error} = validateData(key,value);

        //2. check the validity status of the form
        let formValid = true;
        for(let k in user)
        {
            //console.log(user[k].valid)
            if(user[k].valid === false)
            {
                formValid = false;
                break;
            }
        }
        console.log(formValid);

        //3. call to dispatch - updating the state
        dispatch({type: "update",data:{key,value,touched:true,valid,error,formValid}})
    }


    return (
        <div>
            <h1> user Form </h1>
            <form>
                username : <input type="text" name="user_name" 
                value={user.user_name.value}
                onChange={(e)=>{handleChange("user_name",e.target.value)}} 
                onBlur={(e)=>{handleChange("user_name",e.target.value)}} />
                <br/>
                <div style={{ display: user.user_name.touched && !user.user_name.valid  ?"block":"none"}}>
                    { user.user_name.error}
                </div>


                password : <input type="password" name="password" 
                value={user.password.value}
                onChange={(e)=>{handleChange("password",e.target.value)}} 
                onBlur={(e)=>{handleChange("password",e.target.value)}} />
                <br/>

                contact : <input type="contact" name="contact" 
                value={user.contact.value}
                onChange={(e)=>{handleChange("contact",e.target.value)}} 
                onBlur={(e)=>{handleChange("contact",e.target.value)}} />
                <br/>

                email : <input type="email" name="email" 
                value={user.email.value}
                onChange={(e)=>{handleChange("email",e.target.value)}} 
                onBlur={(e)=>{handleChange("email",e.target.value)}} />
                <br/>

                <input type="submit" value="Insert"
                disabled={!user.formValid} 
                onClick={(e)=>{submitData(e)}} />

                <input type="reset" value="Clear" 
                onClick={()=>{dispatch({type:"reset"})}}/>
            </form>
            <p> {JSON.stringify(user)} </p>
            
        </div>
    )



}
